import React from 'react';
import { Modal, Button } from 'react-materialize';
import Admin from '../Admin';
import TrgiggerButton from './TriggerButton';

function AdminModal(props) {
    return (
        <>
            <Button href = 'admin-login' className = 'modal-trigger' onClick = {props.onClick}>
            Admin login
            </Button>
            <Modal id = 'admin-modal' header = 'Admin login'>
                <Admin />
            </Modal>
        </>
    )
}

export default AdminModal;
